import React from "react";
import { useNavigate } from "react-router-dom";
const Reccomendations = () => {
  const navigate = useNavigate();
  return (
    <div>
      <div className="weekly">weekly</div>
      <div className="daily">
        <button
          onClick={() => {
            navigate("/JuzPage");
          }}
        >
          Kursi
        </button>
      </div>
    </div>
  );
};

export default Reccomendations;
